import axios from "axios";

export const deleteLock=() => {
    
    return axios
        .post('http://localhost:5000/api/delete_lock_id')
        .then(res => {
            console.log('Данные успешно были отправлены');
            return res.data;
        })
        .catch((error) => {
            console.log('Данные не были успешно отправлены');
            console.log(error);
        });
};
